import React from 'react';
import Card from './Card';
import {robot} from './robots';



const CardList = () => {
    return (
        <div>
            {
                robot.map(user => {
                    return (
                    <Card 
                    key={user.id} 
                    id={user.id} 
                    name={user.name} 
                    email={user.email} 
                    />
                    );
                })
            }
        </div>
    )
}

export default CardList
